import React from 'react'

export class CreateDestination extends React.Component {

    state = {
        title: ""
    }

    handleTitleChange = e => {
        this.setState({title: e.target.value})
    }

    handleSubmit = e => {
        e.preventDefault()
    }
    render() {
        return(
            <form id="" onSubmit={this.handleSubmit}>
              <p>
                <input
                  type="text"
                  onChange={(e) => this.handleTitleChange(e)}
                  value={this.state.title}
                  placeholder= "title" />
              </p>
            </form>

        )
    }
}
